    useEffect(() => {
        setEmp(props.data);
    }, [props]);
    

  return (
    <div>
    <div className='sideNav'>
        <SideNav />
      </div>
      <div className="ReadPosts">
            {
                emp && emp.length > 0 ?
                emp.map((emp,index) => 
                   <Card id={emp.id} name={emp.fullName} employee_id={emp.empId} department={emp.dept} designation={emp.role} email={emp.email}/>
                ) : <h2>{'No Employees Yet ðŸ˜ž'}</h2>
            }
        </div>  
    </div>
  );
};

export default ReadPosts;
